<head>

    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Puneet Enterprises</title>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/bulma/0.7.5/css/bulma.css">
    <style>
        html {
            background: #2193b0;
            /* fallback for old browsers */
            background: -webkit-linear-gradient(to right, #2193b0, #6dd5ed);
            /* Chrome 10-25, Safari 5.1-6 */
            background: linear-gradient(to right, #2193b0, #6dd5ed);
            /* W3C, IE 10+/ Edge, Firefox 16+, Chrome 26+, Opera 12+, Safari 7+ */
        }

        .nhi-custom {
            width: 95vw;
            max-width: 37rem;
            padding: 1.5rem;
            margin: auto;
        }

        .panel {
            border-radius: 15px;
            box-shadow: 0 0.5em 1em -0.125em rgba(10, 10, 10, 0.2),
                0 0 0 1px rgba(10, 10, 10, 0.04);
            font-size: 1rem;
        }

        .panel-block,
        .panel-heading {
            border: 0;
        }

        .panel-heading:nth-child {
            border-top: 0;
        }

        .card {
            border-radius: 0.5rem;
            box-shadow: 0 0.5em 1em -0.125em rgba(10, 10, 10, 0.1),
                0 0 0 1px rgba(10, 10, 10, 0.02);
            transition: transform 200ms ease-in;
            margin-top: 2rem;
        }

        .card:hover {
            transform: scale(1.05);
            cursor: pointer;
        }

        .card-content,
        .media {
            overflow: hidden;
        }

        .media-content {
            overflow: hidden !important;
        }

        .progress {
            display: none;
        }

        path{
            fill: #363636;
        }
    </style>
</head>

            var x = document.getElementById(filename + "_loader");
            x.style.display = "block";

            signInAnonymously(auth)
                .then(() => {
                    const storage = getStorage();
                    getDownloadURL(ref(storage, "PDF/" + filename))
                        .then((url) => {

                            console.log(url)
                            window.location.href = url;
                            x.style.display = "none";
                        })
                        .catch((error) => {
                            // console.log(error)
                            alert(error.message)
                            x.style.display = "none";
                            // Handle any errors
                        });
                    // Signed in..
                })
                .catch((error) => {
                    const errorCode = error.code;
                    const errorMessage = error.message;

                    alert(error.message)
                    x.style.display = "none";
                    // ...
                });

        }
        window.getfile = getfile;
    </script>
